import React, { useState } from "react";

import "./Modal.css";

function Modal() {

    const [modal, setModal] = useState(false);

    const toggleModal = () => {
        setModal(!modal);
    }

    return (
        <div >

            <button
                onClick={toggleModal}
                className="btn-modal">Open</button>

            <div className="modal">
                <div className="overlay"></div>
                <div className="modal-content"></div>
                <h1>Hello Modul</h1>
                <p></p>
            </div>
        </div>
    );
}

export default Modal;
